import { Component } from "react";
import Button from "./Button";
import Title from "./Title";
import { Link } from "react-router-dom";
import './App.css';

class Home extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="home">
                <div className="content">
                    <Title text="Home"/>
                    <div className="button-area">
                        <Link to="/login">
                            <Button text="Login"/>
                        </Link>
                        <Link>
                            <Button text="SignUp"/>
                        </Link>

                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
